import React from 'react';
// import logo from './logo.svg';
import './App.css';
import {Switch, Route} from 'react-router-dom';
import Home from './pages/home';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route Exact path="/" component={Home} />
      </Switch>
    </div>
  );
}

export default App;
